import { Fragment, FunctionComponent } from "react";

import PageHeader from "../Components/Atoms/PageHeader";
import OpeningHoursList from "../Components/Molecules/OpeningHoursList";


const OpeningHours: FunctionComponent = () => {

    return (
        <Fragment>
            <PageHeader title='Openingstijden' />
            <div className="page-container opening-hours-container">
                <OpeningHoursList />
            </div>
        </Fragment>
    );
}

export default OpeningHours;
